import { Row, Card, Col, Button, Nav } from "react-bootstrap";
import products from "./products";
import Product from "./Product";
import Registration from "./Registration";
export default function () {
  return (
    <>
      <Row>
        {products.map((product, i) => {
          {
            <Product />;
          }
        })}
      </Row>
    </>
  );
}
